import './Navbar.css';
import { FaDollarSign, FaShoppingCart, icons } from "react-icons/fa";
import {Link} from "react-router-dom";

function Navbar() {
  
  return (

    <div className="topnav" id="Tnav">
         <nav className=''></nav>
         <div className='Fas'>
          <FaDollarSign />
          <FaShoppingCart />
        </div>
    </div>

  );
}

export default Navbar;
